exports=async function(bid,options){const{parseCatalog,cleanCatalogWrapper,hrefRecordRegex}=await require("transcode/parse_catalog");return parseCatalog(`https://wap.miaoshufang.org/book/${bid}/all.html`,{cleaner:html=>cleanCatalogWrapper(html,/id="chapterlist"[^>]*>/),recordRegex:hrefRecordRegex},{clientOptions:{...(options&&options.clientOptions)}})};